    "2013-03-16T00:07:44.465336",nt"name": "hydrologic-reconnaissance-of-rush-valley-tooele-county-utah",nt"isopen":
    false,nt"url": null,nt"notes": "Rush Valley is an elongated depression
    that covers about 250,000 acres and is part of a drainage basin that covers about
    470,000 acres. The valley extends about 30 miles from Stockton in T. 4 S., R. 5
    W., southward to the Sheeprock Mountains. The main groundwater reservoir is in unconsolidated
    rocks of late Tertiary (?) and Quaternary age. The source of all water in Rush Valley
    is the 550,000 acre-feet of precipitation that falls mainly on the Oquirrh, Stansbury,
    Onaqui, and Sheeprock Mountains. The estimated maximum potential long-term average
    annual runoff from the uplands is 70,000 acre-feet of water. No surface water leaves
    the topographically closed valley.",nt"license_title": null,nt"extras":
